import { Component } from "react";
import './card.styles.css';

class Card extends Component{
    render(){
        const {name, email, id} = this.props.val
        return(<div className='card-container' key={id}>
                    <img alt={`monster ${name}`}  src={`https://robohash.org/${id}?aet=set2&size=180x180`} />
                    <h2>{name}</h2>
                    <p>{email}</p>
              </div>)
    }

}

export default Card;
